eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   publications: () => (/* binding */ publications)\n/* harmony export */ });\nconst publications = [\n    {\n        id: \"ji-casa\",\n        title: \"Journ\\xe9e d'Integration de l'UGESM section Casablanca\",\n        author: {\n            name: \"Auteur inconnu\",\n            university: \"\",\n            image: \"/images/logo.png\"\n        },\n        date: {\n            day: \"18\",\n            month: \"Janvier\",\n            year: \"2025\"\n        },\n        image: \"/images/publications/p2.jpg\",\n        category: \"evenements\",\n        tags: [\n            \"Integration\",\n            \"Casablanca\",\n            \"\\xc9tudiants\",\n            \"UGESM\",\n            \"\\xc9v\\xe9nement\"\n        ],\n        excerpt: \"Une journ\\xe9e d'int\\xe9gration r\\xe9unissant les nouveaux \\xe9tudiants et les anciens laur\\xe9ats pour renforcer l'esprit d'appartenance et de solidarit\\xe9.\",\n        content: `Dans le cadre de la célébration des étudiants sénégalais poursuivants leurs études au Maroc, l'Union Générale des Étudiants et Stagiaires Sénégalais au Maroc (UGESM) a organisé une journée d'intégration réunissant les nouveaux etudiants et les anciens lauréats pour renforcer l'esprit d'appartenance et de solidarité. Cette rencontre a constitué une occasion de célébrer les réalisations des anciens lauréats, et les rendre hommage, afin de fournir une plateforme pour échanger leurs expériences et concrétiser leurs ambitions académiques et professionnelles. Au sein cet événement, l'Union vise à renforcer les liens culturels et socials entre ses membres et souligner l'importance de l'éducation comme un moyen de développement et d'intégration dans la société marocaine.`,\n        videoUrl: \"https://youtu.be/xRNn_3mJHe8?si=_38L-PksSyvPWXKV\"\n    },\n    {\n        id: \"maroc-espagne-crise\",\n        title: \"MAROC–ESPAGNE : DEUX ROYAUMES UNE CRISE\",\n        author: {\n            name: \"Papa Ousmane FAYE\",\n            university: \"Universit\\xe9 Cadi AYYAD de Marrakech\",\n            image: \"/images/publications/p1.jpeg\"\n        },\n        date: {\n            day: \"06\",\n            month: \"Juin\",\n            year: \"2021\"\n        },\n        image: \"/images/publications/emigration.jpg\",\n        category: \"G\\xe9opolitique\",\n        tags: [\n            \"Relations Internationales\",\n            \"Migration\",\n            \"Diplomatie\",\n            \"Maroc\",\n            \"Espagne\"\n        ],\n        excerpt: \"Une analyse approfondie de la crise diplomatique et migratoire entre le Maroc et l'Espagne, mettant en lumi\\xe8re les enjeux g\\xe9opolitiques et le r\\xf4le strat\\xe9gique du Maroc dans la r\\xe9gion m\\xe9diterran\\xe9enne.\",\n        content: `Qui est Papa Ousmane FAYE?\nJeune activiste panafricain engagé au Maroc, il est le Président de l'ONG African Citizens Association et a reçu la nomination d'Ambassadeur JADE 2019. Membre actif de la CESAM depuis 2014, il est le conseiller du bureau exécutif de la CESAM Settat et fut Secrétaire Général de l'UGESM Settat en 2015. Economiste de formation, il est titulaire d'un master en Géopolitique et Relations Internationales à l'Université Cadi AYYAD de Marrakech et actuellement doctorant en Sciences Politiques. Il est aussi enseignant à l'Université Privée de Marrakech.\n\n\nDeux royaumes voisins paisibles qui se fâchent souvent se sont à nouveau querellés provoquant une crise sur un sujet très sensible dans les relations internationales, la migration. Nous n’ignorons aucunement l’importance et la place de la question migratoire sur les tables de négociations sur quoi repose l’échiquier politique mondial. Elle est devenue comme le montre De Wenden une question de souveraineté et un facteur de recomposition des sphères d’influence et que « le changement de regard sur la migration : politiquement marginale hier, elle est devenue un enjeu international central aujourd’hui(1) ». Pour vous dire qu’une question globale retenti dans les oreilles des citoyens informés suite à une noyade de ces derniers dans les médias qui titrent par exemple en gros caractère « Crise des migrants à Ceuta : il est temps de sortir d’une certaine naïveté dans le regard porté sur le Maroc(2)» après que les migrants aient mouillés leur maillot au cours d’une longue traversée de mer, la presse s’y est mise à son tour en versant l’encre pour mouiller les journaux afin d’informer au monde le déclenchement d’une crise migratoire sans précédent. Le lundi 17 mai 21, plus de 8000 migrants pénètrent en quelques heures dans le territoire de Ceuta, une enclave espagnole sur le sol marocain. Et la question qui se pose ici est comment cela est-il possible ? Suite à une crise diplomatique entre l’Espagne et le Maroc pour cause de la couverture espagnole lors de l’entrée du leader du Polisario, le mouvement indépendantiste sahraoui, Brahim Ghali à Madrid pour motif médical. Voilà ce qui se passe au lendemain de la reconnaissance des Etats-Unis de la souveraineté marocaine sur le Sahara. Dans la course d’une conquête diplomatique où ses intérêts propres comptent, le Maroc ne peut tolérer aucun signe moqueur à son égard surtout pour un enjeu tel que le Sahara Occidental. C’est alors une crise diplomatique suivie d’une crise migratoire entre les deux royaumes, qui fait couler beaucoup d’encre et qui secoue le champ politique international. Cependant, des questions surgissent dans la foulée et qu’il serait important de tenter de les élucider. Primo quelle position occupe le Maroc dans la région méditerranéenne ? Secundo quel rôle ou quelle fonction y exerce-t-il ? Tertio le Maroc d’hier est-il celui d’aujourd’hui ? Voilà quelques questions qui structureront notre analyse auxquelles il s’agira d’apporter des éléments de réponse tout au long de cet article.\n\n(1)Catherine Wihtol de Wenden, « La question migratoire au XXIe siècle : migrants, réfugiés et relations internationales /.- 2e édition revue et augmentée. – Paris : Presse de Sciences Po, 2013, p41.\n(2)Journal le Monde, publié le lundi 21 mai 2021, dernière consultation le 27 mai 2021.\n\nUne confirmation de la position stratégique du Maroc\nLe Maroc a encore montré qu’il occupe une position stratégique en Afrique et dans le monde. Sa position géostratégique lui confère un atout majeur dans le cadre d’un partenariat avec l’Union européenne et en premier lieu l’Espagne sur les questions de sécurité, de renseignement et surtout migratoire. Sa place incontournable sur la table des négociations sur ces questions dans la région fait de lui un acteur de valeur sûre et se veut d’agir comme tel. Autrement dit le royaume chérifien veut dorénavant prouver que son partenariat et ses relations de bon voisinage avec l’Espagne doivent être dans les deux sens et non en sens unique comme l’indique son ministre des Affaires étrangères Nasser Bourita(3). Ce qui prouve que « parallèlement la vision d’un voisinage euro-méditerranéen et euro-africain en mutation s’esquisse dans l’expérience du Maroc émergent. Riche de son profil géopolitique, conscient de l’ampleur des défis, le Maroc, sans renier son identité, aspire à se tourner vers l’avenir et à renforcer son assise régionale et internationale(4) » . Voici alors ce que nous enseigne le bras de fer diplomatique que joue le royaume, consistant à donner plus de tonus à sa diplomatie et redorer son image à l’international. Les lions de l’atlas rugissent alors pour exprimer non seulement leur souveraineté sur leur territoire, mais aussi leur volonté de puissance régionale qui ne se quémande guère quitte à enclencher une rupture des relations diplomatiques avec son voisin. De ce fait, Rabat exige bien le respect, car entre deux partenaires c’est-à-dire deux États souverains, se considérant d’égal à égal, la mutualité se doit sans équivoque de bien marcher.\n\nUn acteur clé de la gestion migratoire : le Maroc une porte africaine de l’Europe\nLe Maroc se situe à une dizaine de kilomètres de la terre européenne et les enclaves Ceuta et Melilla sur son sol lui confèrent une posture importante dans l’agenda de lutte contre l’immigration clandestine. Pour cause, depuis la mise en place de l’espace Schengen, dans les années 1990, il était question de régler d’une manière multilatérale entre les pays européens et les pays africains, les problèmes migratoires. De ce fait, la lutte portait sur l’immigration clandestine. Et vingt-cinq ans plus tard, on revient sur le sujet notamment avec le sommet de Malte Euro-Afrique qui s’est tenu en novembre 2015. Cette rencontre avait pour but d’arriver à des accords à cinq niveaux : l’identification profonde des causes et y trouver des solutions grâce au renforcement de la stabilité et de la dynamique économique ; l’adoption d’un cadre approprié à la migration légale ; le renforcement de la protection des migrants et des demandeurs d’asile ; l’éradication de l’exploitation des migrants et de la traite humaine ainsi que l’amélioration des conditions de retour et de réadmissions5.\n\n(3) Le ministre des Affaires étrangères Nasser Bourita, invité de Wendy Bouchard\n(4) Mehdi Taje, « Géopolitique du Maroc : vers l’émergence », in « Le Maroc Stratégique », sous la direction de Bouchra Rahmouni Benhida, Casa Express éditions- Décartes & Cie, Rabat-Paris, 2013, p.53-54.\n\nDe par cette rencontre internationale, nous pouvons comprendre la volonté européenne sur la politique migratoire à adopter. En effet « elle mène vers une gestion interne des États, ce qui in fine aboutit à une externalisation et/ou une délocalisation de la politique d’asile vers les pays limitrophes. Le projet est donc la gestion des migrants de l’autre côté des frontières (6)» . Toutefois rappelons aussi la Politique Européenne de bon Voisinage (PEV) avec la loi de 2005 relative à la migration inscrite dans les accords bilatéraux UE-Maroc.\nVoici à l’issue de la mise en place de cette politique migratoire européenne, l’entrée en jeu du profil marocain dans la gestion migratoire en lui donnant un rôle incontournable à jouer. C’est ainsi alors que le royaume chérifien de par sa position géostratégique devient un acteur clé grâce au fait que très tôt les autorités marocaines prennent conscience de l’importance de leur fonction dans les questions géopolitiques en l’occurrence une épineuse question qui est la migration clandestine à destination de l’Europe. Cependant, il comptabilise un bon bilan dans cette gestion en démantelant 8000 cellules de trafic d’être humain, faisant avorter 14000 tentatives de migrations dont 80 tentatives d'assaut sur la ville de Sebta et a échangé avec l'Espagne 9000 informations sur la migration clandestine, selon le ministre des affaires étrangères N. Bourita(7).\n\nPar ailleurs, n’oublions pas que le Maroc a été le lieu d’une rencontre internationale historique qui a abouti à la signature du « Pacte mondial pour des migrations sûres, ordonnées et régulières ». Les 10 et 11 décembre 2018, « 164 États et de gouvernements ou leur représentant ont signé le texte désormais intitulé le « pacte de Marrakech»(8). Le but de ce pacte est le renforcement des fondations de la gouvernance mondiale des questions migratoires . Il va sans dire que si le Maroc a accueilli ce rendez-vous de l’histoire inscrit dans les pages des œuvres de géopolitique et de relations internationales ainsi que dans les papiers de discussions des think tanks du monde, c’est qu’il est, sans aucune réfutation, un acteur clé dans la gestion migratoire Afrique-UE une région centrale dans le monde. Pour preuve, notons « qu’au même moment que la signature du pacte de Marrakech, était installé au Maroc le siège d’un observatoire africain sur les migrations et le développement qui a pour objectifs d’harmoniser les stratégies nationales des pays africains et d’améliorer les interactions avec leurs partenaires, c’est-à-dire principalement les européens»(9).\n\n(5)Papa Ousmane Faye, « Le projet d’adhésion du Maroc à la CEDEAO : quels enjeux pour le futur regroupement régional ?, mémoire, Sous la direction de Aicha Abounai, Université Cadi Ayyad, Marrakech, 2019, p.72.\n(6)Ibid. P.73.\n(7)Le ministre des Affaires étrangères Nasser Bourita, invité de Wendy Bouchard, Op.cit.\n(8)Matthieu Tardis, « Le pacte de Marrakech, vers une gouvernance mondiale des migrations ? » Notes de l’IFRI, Ifri, février 2019, p.5.\n(9)Ibid. \n\nLe Maroc : un pays de transit et/ou d’accueil de migrants internationaux\nDepuis quelques années, le royaume chérifien est considéré comme une terre d’accueil des migrants d’origine subsaharienne. Cet état de fait ne veut pas dire qu’il n’est plus un point de transit des migrants clandestins et cette crise causant la baisse des gardes marocaines a montré qu’il l’est toujours. En réalité il faut comprendre le processus de changement de paradigme passant d’un pays de transit à une terre d’accueil. « Le contexte géopolitique régional actuel, les mutations profondes de l’économie marocaine et de sa politique interne comme extérieure sont des facteurs à prendre en compte dans notre analyse, pour davantage appréhender ce changement de paradigme qui fait du Maroc un pays très convoité par les subsahariens, pour l’installation au détriment du transit ». Allons plus loin pour dire qu’aujourd’hui il est attractif parce que son économie se porte bien et que les jeunes subsahariens arrivent à trouver une activité économique dans les secteurs formel et informel. Comparé aux économies et au climat politique des pays d’origine de ces jeunes, il est à noter qu’elles sont touchées par un chômage qui a atteint son paroxysme sur fond d’une instabilité politique et d’insécurité chronique pour certains, par conséquent l’économie marocaine permet à ces derniers de pouvoir se débrouiller et s’en sortir mieux que chez eux. Ceci dit, il y a un élément important à prendre en compte qui a permis cette ouverture pour un changement de paradigme est la politique migratoire nationale qui consiste à la régularisation des migrants en leur accordant des titres de séjour et de vivre en toute légalité dans le royaume, en élément clé d’ouverture au marché du travail et aux entrepreneurs. À juste titre, plus de 50.000 migrants ont été régularisés suite aux deux opérations de régularisation (2014-2018) de la part des autorités publiques . Ainsi « L’observation conduit à dire que le Royaume du Maroc entre dans une politique intégrationniste sans précédent, visant à réinsérer les migrants clandestins et les jeunes venus se former au sein de sa société. Les migrants illégaux qui tentaient de rejoindre l’Europe avec d’énormes difficultés, sachant actuellement que leur économie n’est plus aussi forte comme avant causant un repli identitaire et favorisant les mouvements nationalistes, trouvent que le Maroc est devenu une aubaine en Afrique. Ainsi nous dégageons la formule suivante : essor économique + sécurité + stabilité politique + politique d’accueil (intégration, insertion) ne peut que donner une attractivité au Maroc».\n\n(10)Tardis, op. cit. p.27.\n(11)Faye, op. cit. p.74.\n(12)Royaume du Maroc, Haut-commissariat au plan, “ la migration internationale au Maroc : résultats de l’enquête nationale sur la migration internationale2018-2019, 2020, p.3.\n\n\nUne jeunesse marocaine entre deux crises et une opportunité\nD’abord, soulignons que nous sommes en pleine crise sanitaire et que la pandémie n’a épargné aucune nation. Ainsi le Maroc est frappé de plein fouet par la crise du Covid19 dont les conséquences économiques ne sont plus à démontrer. Face à cette crise, beaucoup de secteurs, comme celui du tourisme est très impacté et nous savons à quel degré ce domaine est capital pour l’économie marocaine. Alors fortement vidé de ses ressources, son personnel se trouve au chômage ce qui se répercute sur le taux de chômage qui enregistre une hausse allant de 9,4 à 12,2%, selon le Haut-commissariat au plan. Cette situation cause une inactivité des jeunes et des plus âgés qui pendant plus d’une année sont cloués chez eux dans l’oisiveté. Sachez que cette jeunesse également pense toujours à un destin meilleur qu’elle croit pouvoir se réaliser en dehors des frontières, c’est-à-dire juste à côté, en Europe. Donc cet eldorado qu’elle a en ligne de mire demeure une cible dont dès que l’opportunité se présente elle ne sera pas à rater. Voilà pendant que surgit la crise diplomatique poussant aux gardes de relever les rideaux, ces individus n’ont pas hésité à saisir une opportunité exceptionnelle : monter sur la scène en passant de l’autre côté des rideaux. Suite à cet événement, Ceuta devient pour une nouvelle fois le théâtre d’une crise migratoire.\n\nGrosso modo, cette crise entre les deux royaumes nous donne beaucoup d’enseignements dont des leçons importantes à en tirer. L’éveil des consciences pour une nouvelle dynamique des relations Nord-Sud, autrement dit Europe-Afrique, pour un nouveau partenariat et une nouvelle représentation est cette flamme qui doit allumer une lumière nouvelle. Le passé obscur se doit d’être remplacé par un futur éclairé à travers un présent fort accompagné d’une volonté de mutation de la coopération entre l’Afrique et le reste du monde. Maintenant les questions qui se posent sont les suivantes : de quelle nature seront les relations entre le Maroc et l’Espagne (et pourquoi pas aussi l’UE) à la sortie de cette crise ? Et jusqu’où cette crise peut-elle aller ? Permettra-t-elle l’engendrement d’une nouvelle configuration qui donnera gain de cause à Rabat ? Le champ des possibles ne sera ouvert que par une politique lucide, rationnelle et volontariste, guidée par des leaders de convictions. Enfin tout ce qui compte en politique c’est une vision éclairée.\n\n13Faye op. cit. p.76.`\n    }\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./src/data/publications.ts\n");

